import React from 'react'
import styled from 'styled-components'
import { Margin16 } from '../component/styledComponent'

const Title = styled.text`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 700;
  font-size: 18px;
  line-height: 18px;
  color: #000000;
`
const Content = styled.text`
  font-family: 'Spoqa Han Sans Neo';
  font-style: normal;
  font-weight: 400;
  font-size: 14px;
  line-height: 22px;
  color: #000000;
`

interface TermBoxProps {
  title: string
  content: string
}
export const TermBox = (props: TermBoxProps) => {
  const { title, content } = props
  return (
    <>
      <Title>{title}</Title>
      <Margin16 />
      <Content>{content}</Content>
    </>
  )
}
